CREATE TABLE `movie` (
  `movie_id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(500) NOT NULL,
  `release_year` int(11) DEFAULT NULL,
  `director_id` int(11) DEFAULT NULL,
