  `language_id` int(11) DEFAULT NULL,
  `rating_id` int(11) DEFAULT NULL,
  `imdb_score` decimal(3,1) DEFAULT NULL,
  `duration_minutes` int(11) DEFAULT NULL,
  `num_critics` int(11) DEFAULT NULL,
  `gross` int(11) DEFAULT NULL,
  `budget` bigint(20) DEFAULT NULL,
  `facebook_likes` int(11) DEFAULT NULL,
  `imdb_link` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`movie_id`),
  UNIQUE KEY `movie_id` (`movie_id`),
  KEY `country_id` (`country_id`),
  KEY `director_id` (`director_id`),
  KEY `language_id` (`language_id`),
  KEY `rating_id` (`rating_id`),
  CONSTRAINT `movie_ibfk_1` FOREIGN KEY (`country_id`) REFERENCES `country` (`country_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `movie_ibfk_2` FOREIGN KEY (`director_id`) REFERENCES `director` (`director_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `movie_ibfk_3` FOREIGN KEY (`language_id`) REFERENCES `movie_language` (`language_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `movie_ibfk_4` FOREIGN KEY (`rating_id`) REFERENCES `rating` (`rating_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4964 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
